function showCharacterProfile(character){$('.character-evo-stage').css('position','absolute');$('#sec3-stage3-div').css('position','relative');$('#sec3-text-div p').css('opacity',0);$('#sec3-text-div p').fadeTo(500,1);$('#sec3-stage1-div').fadeOut('slow');$('#sec3-stage2-stars-div').fadeOut('slow');$('#sec3-stage2-umbrellas-div').fadeOut('slow');$('#sec3-stage3-div').fadeIn('slow');profile_portrait='';profile_title='';profile_content='';type=1;if(character=='star1'){type=1;profile_portrait='alice.png';profile_title="Alice";profile_content="<strong>Bio:</strong><br/>"+"A former security officer for Umbrella, Janus (code name Alice) worked undercover to expose the company's "+"illegal research experiments before being rendered an amnesiac during the course of the outbreak. Alice was "+"subsequently captured by Umbrella and injected with the T-Virus, imbuing her with superhuman powers that "+"were subsequently stripped (and later seemingly restored) by former Umbrella head honcho Albert Wesker. "+"With the human race on its last legs in The Final Chapter, Alice sets out to take down Umbrella once and for all."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Psychic abilities including telekinesis (with T-Virus); martial arts expert, weapons specialist, all-around badass (without T-Virus)";}
else if(character=='star2'){type=1;profile_portrait='claire.png';profile_title="Claire Redfield";profile_content="<strong>Bio:</strong><br/>"+"As the fearless leader of a group of post-outbreak survivors, Claire (brother of S.T.A.R.S. operative Chris "+"Redfield) became one of Alice's most crucial allies, assisting greatly in her efforts to take down Umbrella "+"and prevent the further spread of the T-Virus. Though her fate was left up in the air following the events "+"of Afterlife, Claire has returned to fight alongside Alice once last time in The Final Chapter."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Advanced physical abilities, skilled marksman, peerless survival instincts";}
else if(character=='star3'){type=1;profile_portrait='abigail.png';profile_title="Abigail";profile_content="<strong>Bio:</strong><br/>"+"One of the sole remaining uninfected members of the human race and a member of Claire and Doc's scrappy "+"band of survivors, Abigail joins up with Alice in her final attempt to save humanity from destruction. "+"A mechanical master and weapons specialist, Abigail is a smart, tough-as-nails ally in Alice's latest "+"showdown with Umbrella."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Mechanical expert, weapons virtuoso, nerves of steel";}
else if(character=='star4'){type=1;profile_portrait='character1.png';profile_title="Doc";profile_content="<strong>Bio:</strong><br/>"+"The leader of the small group of human survivors holed up in a base near Raccoon City, Doc is romantically "+"involved with Claire but - like everyone else in the post-outbreak world - his number one goal is survival."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Advanced physical abilities, skilled marksman, peerless survival instincts";}
else if(character=='umbrella1'){type=2;profile_portrait='albert-wesker.png';profile_title="Albert Wesker";profile_content="<strong>Bio:</strong><br/>"+"Umbrella Corp chairman Wesker turned the T-Virus on himself in an effort to transform into a superhuman "+"warrior, but the experiment backfired when the virus took on a mind of its own. Perpetually at odds with "+"lead Umbrella scientist Dr. Sam Isaacs, Wesker defected from the organization after the Red Queen took "+"control and formed an uneasy alliance with Alice."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Superhuman strength and speed, advanced regenerative powers, maniacal brilliance";}
else if(character=='umbrella2'){type=2;profile_portrait='isaacs.png';profile_title="Dr. Alexander Isaacs";profile_content="<strong>Bio:</strong><br/>"+"The brilliant but disturbed Umbrella scientist was responsible for injecting Janus/Alice with the T-Virus "+"and creating an army of clones in her image. In defiance of Wesker, he spawned a breed of super undead "+"using the clones' blood. Isaacs later injected himself with the virus to counteract a zombie bite, "+"transforming himself into a monstrous, tentacled Tyrant in the process. Though Alice seemingly put an end "+"to him in Extinction, Isaacs has now returned, more diabolical than ever."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Superhuman strength, advanced healing ability, tentacle generation, fierce intelligence";}
else if(character=='umbrella3'){type=2;profile_portrait='red-queen.png';profile_title="Red Queen";profile_content="<strong>Bio:</strong><br/>"+"The Umbrella-engineered supercomputer takes the holographic form of a young girl, but there's nothing "+"harmless about the artificially-intelligent program, which has made the extermination of the human race "+"its primary objective."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Mind control, freedom from emotion, dry sense of humor";}
else if(character=='umbrella4'){type=2;profile_portrait='character1.png';profile_title="Commander Lee";profile_content="<strong>Bio:</strong><br/>"+"Umbrella henchman Commander Lee is a strong warrior, both physically and mentally. In The Final Chapter, "+"he uses his superior fight and weapons training to try and prevent Alice and her cohorts from achieving "+"their objectives."+"<br/><br/>"+"<strong>Powers:</strong><br/>"+"Martial arts skills, firearms training";}
    $('#profile-portrait').attr('src','//cdn.wovendigitaldev.com/resident-evil/images/'+profile_portrait);$('#profile-title').html(profile_title);$('#profile-content').html(profile_content);if(type==1){$('#back-umbrellas-btn').css('display','none');$('#back-stars-btn').css('display','block');}
    else if(type==2){$('#back-stars-btn').css('display','none');$('#back-umbrellas-btn').css('display','block');}
    gaEventTrack('CHARACTER EVO - '+profile_title+' Profile','clicked');}
function preload(arrayOfImages,parent_id){$(arrayOfImages).each(function(){$('<img />').attr('src','//cdn.wovendigitaldev.com/resident-evil/images/ani/'+this).appendTo('#'+parent_id).addClass('ani-frame');});}
function animateTimeline(){$('#red-line').animate({'left':'1.37vw'},thick_line_time);$('#original-line').animate({'left':'33.33vw'},thick_line_time);$('#alternate-line').animate({'left':'33.33vw'},thick_line_time);$('#line1').delay(thick_line_time).animate({'height':'13.63vw'},thin_line_time);$('#line2').delay(thick_line_time).animate({'height':'7.2vw'},thin_line_time);$('#line3a').delay(thick_line_time).animate({'height':'12.38vw'},thin_line_time*0.5);$('#line3b').delay(thick_line_time+thin_line_time*0.5).animate({'width':'7.62vw'},thin_line_time*0.5);$('#line4').delay(thick_line_time).animate({'height':'26.96vw'},thin_line_time);$('#line5').delay(thick_line_time).animate({'height':'9.35vw'},thin_line_time);$('#line6').delay(thick_line_time).animate({'height':'20.12vw'},thin_line_time);$('#line7').delay(thick_line_time).animate({'height':'29.76vw'},thin_line_time);$('#line8').delay(thick_line_time).animate({'height':'12.56vw'},thin_line_time*0.7);$('#line9').delay(thick_line_time+thin_line_time*0.7).animate({'width':'3.99vw'},thin_line_time*0.3);$('#line10').delay(thick_line_time+thin_line_time*0.5).animate({'width':'1.15vw'},thin_line_time*0.5);$('#line11').delay(thick_line_time).animate({'height':'5.12vw'},thin_line_time);$('#line12').delay(thick_line_time+thin_line_time*0.5).animate({'width':'2.14vw'},thin_line_time*0.5);$('#line13').delay(thick_line_time).animate({'height':'17.2vw'},thin_line_time);$('#line14').delay(thick_line_time+thin_line_time*0.5).animate({'width':'2.14vw'},thin_line_time*0.5);$('#line15').delay(thick_line_time).animate({'height':'12.92vw'},thin_line_time);$('#line16').delay(thick_line_time).animate({'height':'17.14vw'},thin_line_time);$('#line17').delay(thick_line_time+thin_line_time*0.3).animate({'width':'15.48vw'},thin_line_time*0.7);$('#line18').delay(thick_line_time).animate({'height':'17.38vw'},thin_line_time*0.7);$('#line19').delay(thick_line_time+thin_line_time*0.7).animate({'width':'3.69vw'},thin_line_time*0.3);$('.shield').delay(thick_line_time+thin_line_time).animate({'opacity':'1'},fade_in_time);$('.umbrella').delay(thick_line_time+thin_line_time).animate({'opacity':'1'},fade_in_time);setTimeout(function(){$('.umbrella').css('animation-name','pulse');},thick_line_time+thin_line_time+fade_in_time*2);setTimeout(function(){$('.umbrella').css('-webkit-animation-name','pulse');},thick_line_time+thin_line_time+fade_in_time*2);$('.caption').delay(thick_line_time+thin_line_time+fade_in_time*0.5).animate({'opacity':'1'},fade_in_time);}
function showUmbrellaDetails(n){var title='',text='';if(n==1){title='Umbrella opens for business';text="Umbrella, a large pharmaceutical manufacturer, establishes its headquarters in Raccoon City. There it begins manufacturing the T-Virus - designed by Umbrella's scientists to reanimate dead cells - in an underground lab known as The Hive.";}
else if(n==2){title='T-Virus dangers exposed';text='The T-Virus is revealed to have dangerous side effects that transform human beings into mutants and zombies.';}
else if(n==3){title='The Hive melts down';text="An outbreak of the T-Virus in The Hive causes Umbrella's A.I. supercomputer, The Red Queen, to kill off everyone inside in an effort to contain its spread.";}
else if(n==4){title='Alice awakens';text='Alice, a double-agent Umbrella security operative who works in the mansion located above The Hive, has her memory wiped after The Red Queen releases a noxious gas';}
else if(n==5){title='T-Virus spreads';text='The T-Virus spreads across Raccoon City, transforming the population into zombies and mutants.';}
else if(n==6){title='A warrior rises';text='Umbrella captures Alice and injects her with the T-Virus, a procedure that gives her superhuman abilities. She becomes the ultimate weapon, perfectly bonding with the virus.';}
else if(n==7){title='Raccoon City destroyed';text='In a last-ditch effort to stop the spread of the virus, Umbrella drops a nuclear bomb on Raccoon City, decimating it. They blame the disaster on a nuclear plant explosion, but fail to contain the epidemic.';}
else if(n==8){title='Project Alice launches';text="Umbrella scientist Dr. Sam Isaacs officially kicks off \"Project Alice,\" which allows him to track the T-Virus-enhanced Alice's every move via satellite.";}
else if(n==9){title='T-Virus pandemic';text='The T-Virus quickly becomes a global pandemic, transforming the Earth into a mutant and zombie-filled wasteland.';}
else if(n==10){title='Quest for a cure';text='New Umbrella chairman Albert Wesker orders Dr. Isaacs to develop a cure for the T-Virus by creating an army of Alice clones.';}
else if(n==11){title='"Super zombies" unleashed';text='Dr. Isaacs creates the clones, but defies Wesker by using them to spawn an army of "super zombies." After injecting himself with the anti-virus, he transforms into a monstrous mutant known as a Tyrant before Alice defeats him.';}
else if(n==12){title='Arcadia established';text='Umbrella sets up Arcadia, a so-called free zone for survivors which is actually a trap designed to lure more human test subjects.';}
else if(n==13){title='Japanese headquarters destroyed';text="Along with an army of her clones, Alice tracks Wesker to Umbrella's Japanese headquarters, but Wesker destroys the facility along with all of the clones.";}
    $('.modal__inner .modal-title').text(title);$('.modal__inner .modal-text').text(text);gaEventTrack('TIMELINE - '+title,'clicked');}
